// layouts/RestaurantLayout.js
import React from 'react';
import { Outlet } from 'react-router-dom';
import RestaurantHeader from '../components/Restaurant/RestaurantHeader';
import RestaurantFooter from '../components/Restaurant/RestaurantFooter';


const RestaurantLayout = () => {
  return (
    <div className="flex flex-col min-h-screen">
      <RestaurantHeader /> {/* Fixed header */}
      <main className="flex-grow bg-slate-100 py-10 overflow-scroll mt-24">
        <Outlet /> {/* Dynamic content here */}
      </main>
      <RestaurantFooter /> {/* Fixed footer */}
    </div>
  );
};

export default RestaurantLayout;
